import { showRenewHistory } from '../actions/actions'

class GetRequest {
  static getHistory() {
    return function (dispatch) {
      fetch('/his')
        .then((response) => response.json())
        .then((json) => dispatch(showRenewHistory(json)))
    }
  }
}

export default GetRequest
